import axios from "axios";
import { useState } from "react";


export const customerModel = async(items) => {

    const customer = await axios.get("http://localhost:8080/customers");

    return {
        c_id: customer.data[items].id,
          c_name: customer.data[items].c_name,
          c_email: customer.data[items].c_email,
          c_voucher: customer.data[items].c_voucher,
          c_address: customer.data[items].c_address,
          c_post_code: customer.data[items].c_post_code,
          c_handphone_number: customer.data[items].c_handphone_number,
          c_password: customer.data[items].c_password,
          transaction_t_id: customer.data[items].c_password,
    }
};

export const foodModel = async() => {

    const food = await axios.get("http://localhost:8080/foods");

    return {
        // food.data[0]
          f_id: [food.data[0].id, food.data[1].id, food.data[2].id, food.data[3].id, food.data[4].id, food.data[5].id],
          f_name: [food.data[0].f_name, food.data[1].f_name],
          f_price: food.data[0].f_price,
          f_description: food.data[0].f_description,
          f_status: food.data[0].f_status,
        // food.data
    }
};

